import React, {Component, Fragment} from 'react';

class ChannelsComponentItem extends Component {

    constructor(props) {
        super(props);
    }

    render() {

        return (
            <div>
                <p><b>#Channel 1</b></p>
            </div>
        )
    }
}

export default ChannelsComponentItem;
